package helperclasses;

public class FamilyBachPer {
	private int familyper;
	private int bachelorper;
	

	public FamilyBachPer(int familyper, int bachelorper) {
		// TODO Auto-generated constructor stub
		this.setFamilyper(familyper);
		this.setBachelorper(bachelorper);
		
	}


	public int getFamilyper() {
		return familyper;
	}


	public void setFamilyper(int familyper) {
		this.familyper = familyper;
	}


	public int getBachelorper() {
		return bachelorper;
	}


	public void setBachelorper(int bachelorper) {
		this.bachelorper = bachelorper;
	}

}
